const User = ({ transactions }) => {
  return (
    <div className="container mt-4">
      <h2>User Page</h2>
      <h3>Transactions</h3>
      <ul className="list-group mb-4">
        {transactions.map((transaction) => (
          <li key={transaction.id} className="list-group-item">
            {transaction.itemName} - {transaction.quantity} @ {transaction.price} - Status: {transaction.status}
          </li>
        ))}
      </ul>
    </div>
  );
};
